import SignInSvg from "./SignInSvg"
import { createUseStyles } from "react-jss";

const HeaderMiddle = () => {

    const styles = createUseStyles({
        middle: {
            display: "flex",
            height: "158px",
            justifyContent: "space-between"
        }
    });

    const classes = styles()

    return (
        <div className={classes.middle}>
            <h2 className="page-title">Интернет-магазин<br />строительных материалов<br />и инструментов для ремонта</h2>
            <div className="header-middle__contacts">
                <a className="contacts__phone" href="tel:+78125550555">+7(812) 555-05-55</a>
                <address className="contacts__address">г. Санкт-Петербург, ул. Б.Конюшенная, д. 19/8
                </address>
            </div>
            <div className="header-middle__login">
                <ul className="login-list">
                    <li className="login-list__sign-in">
                        <a className="login-link" href="link">
                            <SignInSvg></SignInSvg>
                            <p className="link-deck">Войти:</p>
                        </a>
                    </li>
                    <li className="login-list__sign-up">
                        <a className="login-link" href="link">Регистрация</a>
                    </li>
                </ul>
            </div>
        </div>
    )
}

export default HeaderMiddle
